import { Button, Modal } from "react-bootstrap"

function ModalS(props) {

    return (
        <Modal
            backdrop="static"
            keyboard={false}
        >
            <Modal.Header closeButton>
                <Modal.Title>preencher</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                preencher
            </Modal.Body>
            <Modal.Footer>
                <Button variant="seconday" onClick={props.onHide}>Close</Button>
            </Modal.Footer>
        </Modal>
    );
}

export default ModalS;
